  false,\n\t\"url\": null,\n\t\"notes\": \"This is the list of food-service permitted
  businesses provided by Austin Travis County Health and Human Services Department.
  Please note that the square footage is self-reported, and some businesses may have
  left that information blank on the food-service permit. rnFood-service permitted
  businesses that are within the City of Austinu2019s jurisdiction, but are not yet
  affected by the Universal Recycling Ordinance (URO) Organics Diversion requirements
  can qualify for the zero waste business rebate.rnBusinesses registered as vendors
  with the City of Austin can be searched on the following webpage: https://www.ci.austin.tx.us/financeonline/vendor_connection/search/allsearch.cfmrnFor
  additional questions, contact Austin Resource Recoveryu2019s Business Outreach Team
  at commercialrecycling@austintexas.gov or call 512-974-9727.\",\n\t\"license_title\":
